import React from 'react';
import axios from 'axios';



class Quiz extends React.Component{
  state = {
    words : [],
    quizQuestions : []
  }
  componentDidMount(){
    axios.get('/listwords').then((res) => {
      // console.log(res);
      this.setState({
        words : res.data
      });
    })
  }
  render(){

    return (
      <div>
        {this.state.words[0].word.question}        
      </div>
    );
  }
}

export default Quiz;
